*
     * @desc ログイン中のユーザーの情報を取得します
     * ※ Cookieを送信するためサイトの同一ドメイン上で実行する必要があります
     * @example
     * clipkit.currentUser().then((user) => {
     *   if (user) {
     *     console.log('You are ' + user.screenName);
     *   } else {
     *     console.log('You are a guest.');
     *   }
     * });
     * @return {Promise<User>} ログイン中のUser（未ログインの場合はNULL）

